INSERT INTO `categories` (`id`, `title`, `slug`, `short`, `seotitle`, `seokeywords`, `parent`, `level`, `order`, `featured`, `image`, `map`, `publish`, `created_at`, `updated_at`) VALUES
(1, 'Move to Malta', 'move-to-malta', '<p>Advice on how to move to Malta or Gozo. Services and tips on buying property, applying for permits, legal support, overseas shipping and logistical aspects.</p>', 'MOVE TO MALTA - Read more about how to move to Malta or Gozo. Learn more about services and tips on buying property, applying for permits, legal support, overseas shipping and logistical aspects in Malta and Gozo Mediterranean Island .', 'moving to malta, malta, gozo, buy property, relocate, advice, Wow Malta, WowMalta', 0, 1, 8, 4, NULL, NULL, 1, '2018-03-27 17:23:45', '2018-04-01 19:39:45'),
(2, 'Transport', 'transport', '<p>Travelling to local sights is easy with public transport buses, bus tours, taxi, rent-a-car or the ferry service linking Malta to Gozo and Comino.</p>', 'TRANSPORT - Learn more about the bus system and transport in Malta and Gozo and know your way around the maltese islands. Keep yourself informed on ferries and bus routes to make travel in Malta, Gozo and Comino easier .', 'transport, travel, malta, bus, ferry, boat, taxi, car hire, sightseeing, Wow Malta, WowMalta', 0, 1, 7, 0, NULL, NULL, 1, '2018-03-27 17:23:26', '2018-04-01 19:39:15'),
(3, 'Explore', 'explore', '<p>Visit Malta and explore all the great sites the Maltese Islands have to offer. You&#39;ll find historic temples, &nbsp;breathtaking views and thrilling adventures await you.</p>', 'Visit and explore the Mediterranean Island Malta. Discover Mediterranean Food, Weather , Nightlife , Beaches , Restaurants, Adventure, Cinema. Activities in Malta, Gozo and Comino islands.', 'attractions in malta, places to visit in malta, best time to visit malta, visit malta, what to do in malta,  things to do in malta,  Valletta Malta , museums in malta, top sightseeing places in malta, Wow Malta, WowMalta', 0, 1, 1, 1, NULL, NULL, 1, '2018-03-18 21:57:36', '2018-04-01 20:27:37'),
(4, 'Eat', 'eat', '<p>Eat</p>', 'Find out which are the best places to eat in Malta and Gozo from a list of the top restaurants in the Maltese islands. Information on food, drink, restaurants, bistros, cafes, pubs and snack bars.Eat Drink in the Best Restaurants and Bars in Malta Europe.', 'food in malta, where to eat in malta, drinks in malta , best dining in malta, Mediterranean food in malta, best restaurant in malta, local food in malta, bars in malta, bakery in malta, Wow Malta, WowMalta', 0, 1, 2, 3, NULL, NULL, 1, '2018-03-27 17:20:28', '2018-04-01 19:36:30'),
(5, 'Sleep', 'sleep', '<p>Are you looking for a place to stay in Malta?&nbsp;</p>', 'Read about accommodation in Malta and find out which are the best hotels and apartments to stay in. Hotels, apartments, airbnb , farmhouses in Mediterranean Island Malta , Gozo , Comino.', 'accommodation in malta, where to stay in malta , where to stay in gozo , places to stay in malta, rent in malta, hotels in malta, hotels in gozo, apartments in gozo and malta, farmhouses in malta and gozo, Wow Malta, WowMalta', 0, 1, 3, 0, NULL, NULL, 1, '2018-03-27 17:20:46', '2018-04-01 19:37:05'),
(6, 'Party', 'party', '<p>Malta is the Mediterranean&rsquo;s popular party destination. A fun nightlife scene with clubs, discos, bars, pubs, casinos, gentlemen&rsquo;s clubs and boat parties.</p>', 'PARTY - Experience nightlife in Malta in these clubs, discos, bars, pubs, casinos, gentlemen\'s clubs, parties and events Malta and Gozo', 'party, nightlife, entertainment, bars, disco, boat parties, music, dance, electronic music, strip clubs, scene, paceville, bugibba, valletta, Wow Malta, WowMalta', 0, 1, 4, 0, NULL, NULL, 1, '2018-03-27 17:21:13', '2018-04-01 19:37:40'),
(7, 'Swim', 'swim', '<p>Discover sandy beaches and clear water under the Mediterranean sun. Sunbathing, snorkelling, diving, windsurfing, and water skiing in Malta, Gozo and Comino.</p>', 'SWIM - Discover the best beaches in Malta where you can experience the Maltese sun and sea. Learn more about Marsalforn, Ramla, Golden Bay, Gnejna, Ghajn Tuffieha and more in Malta, Gozo and Comino', 'beach, sea, swim, diving, snorkeling, sun bathing, sand, malta, comino, gozo, blue lagoon, summer, , Wow Malta, WowMalta', 0, 1, 5, 2, NULL, NULL, 1, '2018-03-27 17:21:48', '2018-04-01 19:38:12'),
(8, 'Shop', 'shop', '<p>Shops and retail outlets in Malta sell international clothing brands, local crafts and souvenirs, open air markets have local produce, antiques and other goods.</p>', 'SHOP - Find out which are the best places for shopping in Malta. Know which shops, shopping malls and brands are favoured by the Maltese people in Malta and Gozo .', 'shopping, shop, retail, mall, luxury, sliema, valletta, souvenirs, mdina glass, Wow Malta, WowMalta', 0, 1, 6, 0, NULL, NULL, 1, '2018-03-27 17:22:05', '2018-04-01 19:38:38');
