(1, 'WowMalta - Travel Info Guide for Malta, Gozo & Comino', NULL, 'malta, gozo, comino, travel, info, valletta, wow malta, v18, wowmalta, visit', '<p>Information on the best hotels, restaurants, bars, transport, shops, beaches, nightlife and events on the Maltese islands. Move to Malta.</p>', '<p>WowMalta is Malta&#39;s tourist media portal, bringing you the best and the freshest media from all over the Maltese islands.</p>', NULL, NULL, 'info@wowmalta.com.mt', NULL, 'https://www.facebook.com/wowmalta.com.mt/', 'https://twitter.com/WOWmalta', 'https://www.instagram.com/wowmalta/', 'https://www.pinterest.com/wowmalta/', 'https://plus.google.com/+WowMaltaTravelInfoGuideforMaltaGozoComino', 'https://www.youtube.com/channel/UCKYEEy3c19MaGCQKbp7oU5Q', '<script>\n  (function(i,s,o,g,r,a,m){i[\'GoogleAnalyticsObject\']=r;i[r]=i[r]||function(){\n  (i[r].q=i[r].q||[]).push(arguments)},i[r].l=1*new Date();a=s.createElement(o),\n  m=s.getElementsByTagName(o)[0];a.async=1;a.src=g;m.parentNode.insertBefore(a,m)\n  })(window,document,\'script\',\'https://www.google-analytics.com/analytics.js\',\'ga\');\n\n  ga(\'create\', \'UA-96356133-1\', \'auto\');\n  ga(\'send\', \'pageview\');\n\n</script>', NULL, NULL, '2018-04-01 20:27:04');
