INSERT INTO `towns` (`id`, `name`, `slug`, `order`, `body`, `keywords`, `map`, `publish`, `created_at`, `updated_at`) VALUES
(1, 'Valleta', 'valleta', 1, '<p>Valletta, also known as Il-Belt, is Malta&rsquo;s vibrant capital. Located on a peninsula, the historic fortress city was established by the Knights of Malta in 1566.</p>', 'Valletta, Captial, Old, Historic, Parliament, Architecture, Wow Malta, WowMalta', NULL, 1, '2018-03-27 16:07:01', '2018-04-01 20:25:09'),
(2, 'St. Julians', 'st-julians', 2, '<p>St. Julians is on the islands northern coast. Its many clubs, bars and restaurants in the Paceville area make it the most popular entertainment spot in Malta.</p>', 'St.Julians, Nightclubs, Restaurants, Hotels, Entertainment, Shopping, Wow Malta, WowMalta', NULL, 1, '2018-03-27 16:12:50', '2018-04-01 19:57:40'),
(3, 'Sliema', 'sliema', 3, '<p>With views of Valletta, Sliema is Malta&rsquo;s main northern city. It is a popular commercial area with many shops, restaurants, cafes and a long seafront promenade.</p>', 'Sliema, Shopping, Sea, Restaurants, Cafe, Luxury, Wow Malta, WowMalta', NULL, 1, '2018-03-27 16:13:21', '2018-04-01 19:58:03'),
(4, 'Mdina & Rabat', 'mdina-rabat', 4, '<p>Once Malta&rsquo;s capital, the fortified medieval city of Mdina is known as the &lsquo;Silent City. It is home to St Paul&#39;s Cathedral and several museums.</p>', 'Mdina, Rabat, Historic, Architecture, Old, Cathedral, Wow Malta, WowMalta', NULL, 1, '2018-03-27 16:13:42', '2018-04-01 19:58:26'),
(5, 'Three Cities', 'three-cities', 5, '<p>The Three Cities describe the fortified towns of Birgu, Senglea, and Cospicua, in the South-East of Malta. Find forts, bastions, palaces and a waterfront.</p>', 'Fortified, Cities, Historic, Old, City, Vittoriosa, Senglea, Cospicua, Wow Malta, WowMalta', NULL, 1, '2018-03-27 16:14:07', '2018-04-01 19:58:46'),
(6, 'Gozo & Comino', 'gozo-comino', 6, '<p>Clear sea and beaches on Malta&rsquo;s sister islands Gozo and Comino are easily reached by ferry awaiting to be explored. Each island retains its unique history.</p>', 'Gozo, Comino, Islands, Bluelagoon, Panorama, , Wow Malta, WowMalta', NULL, 1, '2018-03-27 16:14:24', '2018-04-01 19:59:08'),
(7, 'Marsaxlokk', 'marsaxlokk', 7, '<p>Marsaxlokk is an old fishing village in the Southeast of Malta most popular for its Sunday market. Colourful traditional fishing boats, luzzus, dot the harbour.</p>', 'Marsaxlokk, Fishing, Village, South, Eastern, Fish, Sea, Restaurants, Wow Malta, WowMalta', NULL, 1, '2018-03-27 16:14:53', '2018-04-01 19:59:37'),
(8, 'Marsaskala', 'marsaskala', 8, '<p>Situated around a small harbour, Marsaskala is a seaside village in the southeast of Malta. Swimming and windsurfing can be enjoyed in St Thomas Bay.</p>', 'Marsaskala, South, East, Village, Malta, , Wow Malta, WowMalta', NULL, 1, '2018-03-27 16:15:08', '2018-04-01 20:00:00'),
(9, 'Mellieha', 'mellieha', 9, '<p>Mellieha is a popular coastal town in the north of Malta. The town overlooks the largest sandy beach in Malta, Mellieha Bay, which also includes Ghadira Bay.</p>', 'Mellieha, Bay, Sandy, Beach, North, Hotels, Restaurants, Attractions, Wow Malta, WowMalta', NULL, 1, '2018-03-27 16:15:26', '2018-04-01 20:00:25'),
(10, 'Other Towns', 'other-towns', 10, '<p>Malta and Gozo are covered by small villages and larger towns, some have become mainly tourist resort towns while others retain their history and tradition.</p>', 'OtherTowns, Malta, Maltese, Islands, Villages, Wow Malta, WowMalta', NULL, 1, '2018-03-27 16:15:42', '2018-04-01 20:00:51');
